function initializeTitleAnimation() {
    const container = document.querySelector('.hero-title-container');
    if (!container) {
        console.error('Hero title container not found');
        return;
    }



function addPath(svg, d, isAdditional = false) {
    const path = document.createElementNS("http://www.w3.org/2000/svg", "path");
    path.setAttribute('d', d);
    
    if (isAdditional) {
        path.setAttribute('class', 'title-path-filled');
        path.setAttribute('fill', '#fff');
        path.setAttribute('fill-opacity', '0');
        path.style.transition = 'fill-opacity 0.5s ease-in-out';
        path.style.mixBlendMode = 'difference';
    } else {
        path.setAttribute('class', 'title-path');
        path.setAttribute('fill', 'none');
        path.setAttribute('stroke', '#fff');
        path.setAttribute('stroke-width', '2');
        
        // 各パスの長さを個別に計算
        svg.appendChild(path); // 一時的に追加して長さを計算
        const length = path.getTotalLength();
        svg.removeChild(path);
        path.style.strokeDasharray = length;
        path.style.strokeDashoffset = length;
    }
    
    svg.appendChild(path);
    return path;
}


// SVG要素生成時の設定も更新
function createSVG(className, width, height) {
    const svg = document.createElementNS("http://www.w3.org/2000/svg", "svg");
    svg.setAttribute('class', `${className} svg-debug`);
    svg.setAttribute('viewBox', '0 0 800 200');
    svg.setAttribute('preserveAspectRatio', 'xMidYMid meet');
    
    if (className === 'hero-title-additional') {
        svg.style.mixBlendMode = 'difference';
    }
    
    return svg;
}





    // SVG要素の生成
    console.log('Creating SVG elements');
    const mainSVG = createSVG('hero-title-main', 800, 200);
    const subSVG = createSVG('hero-title-rogo', 800, 200);
    const additionalSVG = createSVG('hero-title-additional', 800, 200);

    // パスの追加
    titleData.main.forEach(path => addPath(mainSVG, path, false));
    titleData.sub.forEach(path => addPath(subSVG, path, false));
    titleData.additional.forEach(path => addPath(additionalSVG, path, true));

    // DOMに追加
    container.innerHTML = '';
    container.appendChild(mainSVG);
    container.appendChild(subSVG);
    container.appendChild(additionalSVG);

    // アニメーション開始
requestAnimationFrame(() => {
    // mainのアニメーション
    const mainSVG = document.querySelector('.hero-title-main');
    if (mainSVG) {
        mainSVG.style.opacity = '1';
        mainSVG.classList.add('show');
        const mainPaths = mainSVG.querySelectorAll('.title-path');
        mainPaths.forEach((path, index) => {
            const length = path.getTotalLength();
            path.style.strokeDasharray = length;
            path.style.strokeDashoffset = length;
        });
    }

    // subのアニメーション（少し遅延させる）
    setTimeout(() => {
        const subSVG = document.querySelector('.hero-title-rogo');
        if (subSVG) {
            subSVG.style.opacity = '1';
            subSVG.classList.add('show');
            const subPaths = subSVG.querySelectorAll('.title-path');
            subPaths.forEach((path, index) => {
                const length = path.getTotalLength();
                path.style.strokeDasharray = length;
                path.style.strokeDashoffset = length;
            });
        }
    }, 200); // 500ms遅延

    // additionalのアニメーション（既存のコード）
    setTimeout(() => {
        additionalSVG.classList.add('show');
        const filledPaths = additionalSVG.querySelectorAll('.title-path-filled');
        filledPaths.forEach((path, pathIndex) => {
            setTimeout(() => {
                path.style.fillOpacity = '1';
            }, pathIndex * 30 + 600);
        });
    }, 300);
});


    // 背景との連携
    const backgroundCanvas = document.getElementById('background-canvas');
    if (backgroundCanvas) {
        backgroundCanvas.style.filter = 'brightness(1)';
    }
}

// 以下のCSSも追加が必要です
const style = document.createElement('style');
style.textContent = `
    .title-path-filled {
        fill-opacity: 0;
        transition: fill-opacity 0.5s ease-in-out;
    }

    .hero-title-additional.show .title-path-filled {
        fill-opacity: 1;
    }
`;
document.head.appendChild(style);

// 初期化
document.addEventListener('DOMContentLoaded', initializeTitleAnimation);



// タイトルアニメーション完了イベントのハンドリング
document.addEventListener('DOMContentLoaded', () => {
    const observer = new MutationObserver((mutations) => {
        mutations.forEach((mutation) => {
            if (mutation.target.classList.contains('show')) {
                console.log('Title animation completed, enabling inversion');
                document.dispatchEvent(new CustomEvent('titleAnimationComplete'));
                
                if (window.material && window.material.uniforms) {
                    window.material.uniforms.enableTitleInversion.value = true;
                    updateTitleBounds();
                }
            }
        });
    });

    const titleElements = document.querySelectorAll('.hero-title-main, .hero-title-rogo, .hero-title-additional');
    titleElements.forEach(el => {
        observer.observe(el, { attributes: true });
    });
});



// 既存の初期化処理に追加
document.addEventListener('DOMContentLoaded', () => {
    adjustTitlePosition();
    window.addEventListener('resize', adjustTitlePosition);
});